s:20:\"Fix anchor positions\";s:14:\"#default_value\";s:1:\"0\";s:12:\"#description\";s:174:\"Ensures anchors are correctly positioned only when there is margin or padding detected on the BODY element. This is useful when fixed navbar or administration menus are used.\";s:9:\"#disabled\";b:1;}s:34:\"bootstrap_anchors_smooth_scrolling\";a:6:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:23:\"Enable smooth scrolling\";s:14:\"#default_value\";s:1:\"0\";s:12:\"#description\";s:74:\"Animates page by scrolling to an anchor link target smoothly when clicked.\";s:7:\"#states\";a:1:{s:9:\"invisible\";a:1:{s:36:\":input[name=\"bootstrap_anchors_fix\"]\";a:1:{s:7:\"checked\";b:0;}}}s:9:\"#disabled\";b:1;}}s:5:\"forms\";a:5:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:5:\"Forms\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:38:\"bootstrap_forms_has_error_value_toggle\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:64:\"Automatically remove error classes when values have been entered\";s:14:\"#default_value\";s:1:\"1\";s:12:\"#description\";s:242:\"If an element has a <code>.has-error</code> class attached to it, enabling this will automatically remove that class when a value is entered. This feature compliments the \"General > Forms > Make required elements display as an error\" feature.\";}}s:8:\"popovers\";a:7:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:8:\"Popovers\";s:12:\"#description\";s:104:\"Add small overlays of content, like those on the iPad, to any element for housing secondary information.\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:25:\"bootstrap_popover_enabled\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:16:\"Enable popovers.\";s:12:\"#description\";s:281:\"Elements that have the <code>data-toggle=\"popover\"</code> attribute set will automatically initialize the popover upon page load. <strong class=\"error text-error\">WARNING: This feature can sometimes impact performance. Disable if pages appear to \"hang\" after initial load.</strong>\";s:14:\"#default_value\";s:1:\"1\";}s:7:\"options\";a:16:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:7:\"Options\";s:12:\"#description\";s:180:\"These are global options. Each popover can independently override desired settings by appending the option name to <code>data-</code>. Example: <code>data-animation=\"false\"</code>.\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:7:\"#states\";a:1:{s:7:\"visible\";a:1:{s:40:\":input[name=\"bootstrap_popover_enabled\"]\";a:1:{s:7:\"checked\";b:1;}}}s:27:\"bootstrap_popover_animation\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:7:\"animate\";s:12:\"#description\";s:43:\"Apply a CSS fade transition to the popover.\";s:14:\"#default_value\";s:1:\"1\";}s:22:\"bootstrap_popover_html\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:4:\"HTML\";s:12:\"#description\";s:151:\"Insert HTML into the popover. If false, jQuery\'s text method will be used to insert content into the DOM. Use text if you\'re worried about XSS attacks.\";s:14:\"#default_value\";s:1:\"0\";}s:27:\"bootstrap_popover_placement\";a:5:{s:5:\"#type\";s:6:\"select\";s:6:\"#title\";s:9:\"placement\";s:12:\"#description\";s:225:\"Where to position the popover. When \"auto\" is specified, it will dynamically reorient the popover. For example, if placement is \"auto left\", the popover will display to the left when possible, otherwise it will display right.\";s:14:\"#default_value\";s:5:\"right\";s:8:\"#options\";a:9:{s:3:\"top\";s:3:\"top\";s:6:\"bottom\";s:6:\"bottom\";s:4:\"left\";s:4:\"left\";s:5:\"right\";s:5:\"right\";s:4:\"auto\";s:4:\"auto\";s:8:\"auto top\";s:8:\"auto top\";s:11:\"auto bottom\";s:11:\"auto bottom\";s:9:\"auto left\";s:9:\"auto left\";s:10:\"auto right\";s:10:\"auto right\";}}s:26:\"bootstrap_popover_selector\";a:4:{s:5:\"#type\";s:9:\"textfield\";s:6:\"#title\";s:8:\"selector\";s:12:\"#description\";s:337:\"If a selector is provided, tooltip objects will be delegated to the specified targets. In practice, this is used to enable dynamic HTML content to have popovers added. See <a href=\"https://github.com/twbs/bootstrap/issues/4215\" target=\"_blank\">this</a> and <a href=\"http://jsfiddle.net/fScua/\" target=\"_blank\">an informative example</a>.\";s:14:\"#default_value\";s:0:\"\";}s:25:\"bootstrap_popover_trigger\";a:5:{s:5:\"#type\";s:10:\"checkboxes\";s:6:\"#title\";s:7:\"trigger\";s:12:\"#description\";s:27:\"How a popover is triggered.\";s:14:\"#default_value\";a:3:{s:7:\"\'hover\'\";s:1:\"0\";s:7:\"\'focus\'\";s:1:\"0\";s:7:\"\'click\'\";s:5:\"click\";}s:8:\"#options\";a:4:{s:5:\"click\";s:5:\"click\";s:5:\"hover\";s:5:\"hover\";s:5:\"focus\";s:5:\"focus\";s:6:\"manual\";s:6:\"manual\";}}s:35:\"bootstrap_popover_trigger_autoclose\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:28:\"Auto-close on document click\";s:12:\"#description\";s:108:\"Will automatically close the current popover if a click occurs anywhere else other than the popover element.\";s:14:\"#default_value\";s:1:\"1\";}s:23:\"bootstrap_popover_title\";a:4:{s:5:\"#type\";s:9:\"textfield\";s:6:\"#title\";s:5:\"title\";s:12:\"#description\";s:55:\"Default title value if \"title\" attribute isn\'t present.\";s:14:\"#default_value\";s:0:\"\";}s:25:\"bootstrap_popover_content\";a:4:{s:5:\"#type\";s:9:\"textfield\";s:6:\"#title\";s:7:\"content\";s:12:\"#description\";s:84:\"Default content value if \"data-content\" or \"data-target\" attributes are not present.\";s:14:\"#default_value\";s:0:\"\";}s:23:\"bootstrap_popover_delay\";a:4:{s:5:\"#type\";s:9:\"textfield\";s:6:\"#title\";s:5:\"delay\";s:12:\"#description\";s:116:\"The amount of time to delay showing and hiding the popover (in milliseconds). Does not apply to manual trigger type.\";s:14:\"#default_value\";s:1:\"0\";}s:27:\"bootstrap_popover_container\";a:4:{s:5:\"#type\";s:9:\"textfield\";s:6:\"#title\";s:9:\"container\";s:12:\"#description\";s:300:\"Appends the popover to a specific element. Example: \"body\". This option is particularly useful in that it allows you to position the popover in the flow of the document near the triggering element - which will prevent the popover from floating away from the triggering element during a window resize.\";s:14:\"#default_value\";s:4:\"body\";}}}s:8:\"tooltips\";a:7:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:8:\"Tooltips\";s:12:\"#description\";s:332:\"Inspired by the excellent jQuery.tipsy plugin written by Jason Frame; Tooltips are an updated version, which don\'t rely on images, use CSS3 for animations, and data-attributes for local title storage. See <a href=\"https://getbootstrap.com/docs/3.4/javascript/#tooltips\" target=\"_blank\">Bootstrap tooltips</a> for more documentation.\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:25:\"bootstrap_tooltip_enabled\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:15:\"Enable tooltips\";s:12:\"#description\";s:281:\"Elements that have the <code>data-toggle=\"tooltip\"</code> attribute set will automatically initialize the tooltip upon page load. <strong class=\"error text-error\">WARNING: This feature can sometimes impact performance. Disable if pages appear to \"hang\" after initial load.</strong>\";s:14:\"#default_value\";s:1:\"1\";}s:7:\"options\";a:13:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:7:\"Options\";s:12:\"#description\";s:180:\"These are global options. Each tooltip can independently override desired settings by appending the option name to <code>data-</code>. Example: <code>data-animation=\"false\"</code>.\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:7:\"#states\";a:1:{s:7:\"visible\";a:1:{s:40:\":input[name=\"bootstrap_tooltip_enabled\"]\";a:1:{s:7:\"checked\";b:1;}}}s:27:\"bootstrap_tooltip_animation\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#title\";s:7:\"animate\";s:12:\"#description\";s:43:\"Apply a CSS fade transition to the tooltip.\";s:14:\"#default_value\";s:1:\"1\";}s:22:\"bootstrap_tooltip_html\";a:4:{s:5:\"#type\";s:8:\"checkbox\";s:6:\"#t